import React from "react";

export const Menu = () => {
    return (
        <div className="menu">
            <img className="menu-hamburger-icon" alt="Menu" src={process.env.PUBLIC_URL + '/images/hamburger-menu/hamburger-menu-closed.svg'}></img>
        </div>
    );
}
